import { configureStore } from "@reduxjs/toolkit";
import { useReducer } from "../Reducers/UserReducer";
import { UserReducer } from "./Reducers/UserReducer";

export default configureStore({
  reducer: {
    users: UserReducer.reducer,
  },
});
